import React from "react";
import { ResearchData } from "../data/ResearchPageData";

const Research = () => {
  return (
    <article>
      <h1> Interdisciplinary Research </h1>
      <section>
        {
          ResearchData.map(element => {
            return(
              <section>
              <div> <img src={element.image} alt={element.alt} /> </div>
              <h2> {element.heading} </h2>
              <p> {element.par} </p>
              </section>
            )
          })
        }
      </section>
    </article>
  );
};

export default Research;
